import React,{useEffect,useState} from 'react';
import axios from 'axios';
export default function HabitList(){
  const[habits,setHabits]=useState([]);
  useEffect(()=>{axios.get('http://localhost:8000/api/habits/').then(res=>setHabits(res.data));},[]);
  return(<div><h3>Your Habits</h3>{habits.map(h=><div key={h.id}><h4>{h.name}</h4><p>{h.category} - {h.frequency}</p></div>)}</div>);
}
